import FileInput from "./FileInput";

export default () => {
  return (
    <div>
      <h3>The FORM:</h3>
      <FileInput />
      <p>
        <button
          onClick={() => {
            fetch("http://localhost:3001/new-orders", {
              method: "POST",
              headers: {
                Accept: "application/json",
                "Content-Type": "application/json",
              },
              body: JSON.stringify({ a: 1, b: "Textual content" }),
            })
              .then(res => res.json())
              .then(res => console.log(res));
          }}
        >
          POST STH
        </button>
        <button
          onClick={() => {
            fetch("http://localhost:3001/get-orders")
              .then(res => res.json())
              .then(res => {
                console.log(res);
              });
          }}
        >
          GET ORDERS
        </button>
      </p>
    </div>
  );
};
